Sei pronto a entrare nel vivo del mondo Spezia?
Rimani costantemente aggiornato su tutte le novità relative al club: consulta con un semplice tap le informazioni disponibili su calendario, classifica e risultati raggiunti! Nelle sezioni dedicate, potrai partecipare a quiz, survey e live session: non perderti le esclusive esperienze targate Spezia Calcio!

▶ CARATTERISTICHE DELL’APP

All’interno dell’App trovi numerose funzionalità per farti vivere al meglio tutto ciò che ruota attorno allo Spezia Calcio. Grazie alla piattaforma puoi:

conoscere la classifica e il calendario dei prossimi match;
consultare tutte le news;
conoscere la rosa dei giocatori e i membri dello staff;
accedere a contenuti media esclusivi come foto e video;
seguire live le dirette dei match;
scattarti delle foto con la nostra fancam per personalizzarle con gli stickers della squadra;
scegliere l’MVP di ogni partita e partecipare a minigame come quiz, survey e ask per mettere alla prova la tua conoscenza sul club e regalarti la possibilità di vincere premi e di vivere esperienze esclusive con lo Spezia Calcio.

▶ SPORTXP – SPORT PLATFORM

SportXP è l’innovativa Sport Platform realizzata da IQUII. Il framework è stato pensato per abilitare processi di acquisizione e fidelizzazione della fanbase, attraverso la riorganizzazione dei canali di comunicazione. L’obiettivo è quello di rendere il fan parte attiva della community per un coinvolgimento mai visto prima.

Scopri le caratteristiche e i vantaggi di SportXP su sportxp.net

▶ CONTATTACI

Per scoprire di più, visita il nostro sito web e puoi trovarci sui nostri canali social (Facebook, Instagram, Twitter, YouTube, Spotify, TikTok).
